--SELECT SUM(CAST("Redfin4_1"."homes_sold" AS BIGINT)) AS "sum:homes_sold:ok",   SUM(CAST("Redfin4_1"."inventory" AS BIGINT)) AS "sum:inventory:ok",   SUM(CAST("Redfin4_1"."new_listings" AS BIGINT)) AS "sum:new_listings:ok",   TABLEAU.TO_DATETIME(DATE_TRUNC('MONTH', TABLEAU.NORMALIZE_DATETIME("Redfin4_1"."period_end")), "Redfin4_1"."period_end") AS "tmn:period_end:ok" FROM "Redfin4_1" WHERE ((TABLEAU.NORMALIZE_DATETIME(TABLEAU.TO_DATETIME(DATE_TRUNC('MONTH', TABLEAU.NORMALIZE_DATETIME("Redfin4_1"."period_end")), "Redfin4_1"."period_end")) >= cast('2014-11-01' as DATE)) AND (TABLEAU.NORMALIZE_DATETIME(TABLEAU.TO_DATETIME(DATE_TRUNC('MONTH', TABLEAU.NORMALIZE_DATETIME("Redfin4_1"."period_end")), "Redfin4_1"."period_end")) <= cast('2016-06-01' as DATE)) AND ("Redfin4_1"."property_type" IN ('Condo/Co-op', 'Single Family Residential', 'Townhouse')) AND ("Redfin4_1"."region" = 'Westminster, CA')) GROUP BY 4;
